function init() {
	renderer = new THREE.WebGLRenderer({antialias:true});
	renderer.setPixelRatio( window.devicePixelRatio );
	renderer.setSize( WIDTH, HEIGHT );
	renderer.setClearColor( 0xffffff );
	scene = new THREE.Scene();
	camera = new THREE.PerspectiveCamera(VIEW_ANGLE, ASPECT, NEAR, FAR);
	camera.position.set( 3000, 3000, -1500);
	cameraControls = new THREE.OrbitControls(camera, renderer.domElement);
	cameraControls.target.set(0,0,-1500);//( 3000,0,1700);
	cameraControls.maxDistance = 20000;
	cameraControls.minDistance = 1000;
    cameraControls.minPolarAngle = 0; // radians
    cameraControls.maxPolarAngle = 60; // radians
    cameraControls.minAzimuthAngle = 0; // radians
    cameraControls.maxAzimuthAngle = 0; // radians
	cameraControls.update();
	var container = document.getElementById( 'container' );
	container.appendChild( renderer.domElement );
    var mainLight = new THREE.DirectionalLight( 0x909090, 1, 500 );
    mainLight.position.set(0,3000,-3000);
    mainLight.castShadow = true;
    mainLight.shadowDarkness = 0.3;
    mainLight.shadowCameraRight = 10000;
    mainLight.shadowCameraLeft = -10000;
    mainLight.shadowCameraTop    = 10000;
    mainLight.shadowCameraBottom = -10000;
    mainLight.shadowCameraVisible = false;
    scene.add( mainLight );
    scene.add( new THREE.AmbientLight( 0xaaaaaa ) );
}

