function init_event(){
    domEvents   = new THREEx.DomEvents(camera, renderer.domElement);
    THREEx.DomEvents.eventNames.forEach(function(eventName){    
        if( eventName === 'click'){
            
        }
        if( eventName === 'mousedown' ){
            domEvents.addEventListener(map.children[0], eventName, function(event){click_map(0);}, false);
            domEvents.addEventListener(map.children[1], eventName, function(event){click_map(1);}, false);
            domEvents.addEventListener(map.children[2], eventName, function(event){click_map(2);}, false);
            domEvents.addEventListener(map.children[3], eventName, function(event){click_map(3);}, false);
            domEvents.addEventListener(map.children[4], eventName, function(event){click_map(4);}, false);
        }
        if( eventName === 'mousemove' ){   

        }
        if( eventName === 'mouseover' ){
            domEvents.addEventListener(map.children[0], eventName, function(event){over_map(0)}, false);
            domEvents.addEventListener(map.children[1], eventName, function(event){over_map(1)}, false);
            domEvents.addEventListener(map.children[2], eventName, function(event){over_map(2)}, false);
            domEvents.addEventListener(map.children[3], eventName, function(event){over_map(3)}, false);                                               
            domEvents.addEventListener(map.children[4], eventName, function(event){over_map(4)}, false);  
        }
        if( eventName === 'mouseout' ){
            domEvents.addEventListener(map.children[0], eventName, function(event){out_map(0);}, false);
            domEvents.addEventListener(map.children[1], eventName, function(event){out_map(1);}, false);
            domEvents.addEventListener(map.children[2], eventName, function(event){out_map(2);}, false);
            domEvents.addEventListener(map.children[3], eventName, function(event){out_map(3);}, false);                    
            domEvents.addEventListener(map.children[4], eventName, function(event){out_map(4);}, false); 
        }                   
        if( eventName === 'mouseup' ){

        }
    });
}
function click_map(id){
    if(focused_map != id){
        if(focused_map != -1){
            map.children[focused_map].material.color = normal_color;
            charts[focused_map].visible = false;
            infos[focused_map].visible = false;
            click_effects[focused_map].visible = false;       
        }
        focused_map = id;
        map.children[id].material.color = click_color;
        charts[id].visible = true;
        infos[id].visible = true;
        click_effects[id].visible = true; 

        map_click_event(id);
    }else{
        map.children[focused_map].material.color = normal_color;
        charts[focused_map].visible = false;
        infos[focused_map].visible = false;
        click_effects[focused_map].visible = false;       
    }
}
function over_map(id){
    if(id != focused_map){
        map.children[id].material.color = hover_color;
        charts[id].visible = true;
        infos[id].visible = true;
        click_effects[id].visible = false;
    }
}
function out_map(id){
    if(id != focused_map){
        if(is_region_out){
            map.children[id].material.color = normal_color;
            charts[id].visible = false;
            infos[id].visible = false;
            click_effects[id].visible = false;
        }
    }
}
function over_chart(id){
    is_region_out = false;         
}
function out_chart(id){
    is_region_out = true;
}
